import { React, useState } from "react";
import Cards from "../../Components/Cards/cards";
import Cardbar from "../../Components/CardBar/cardbar";
import "./main.css";
import { Link } from "react-router-dom";
import Header from "../../Layout/Header/secondaryHeader";
import FilterIcn from "../../Assets/Icons/Filter";
import Filter from "../../Components/Filter/filter";
const Main = () => {
  const [filter, setFilter] = useState(false);
  const handleClick = () => {
    setFilter(!filter);
  };
  return (
    <div className="flex ">
      <div className=" mt-[12rem]    items-start justify-center px-[4rem]  ">
        <div className=" hidden filterStarting:hidden filterEnding:block">
          <Filter Filter={filter} className="  w-[20rem]" />
        </div>
        <span
          className="hidden  filterStarting:flex  filterEnding:hidden  "
          onClick={handleClick}
        >
          <FilterIcn />
        </span>
      </div>
      <div className=" flex flex-col px-[20px] md:px-0 ">
        <Header />

        <div className=" mt-[5rem] flex flex-col gap-3">
          <div className=" block self-end filterStarting:hidden ">
            <div className=" flex gap-2 bg-SecondaryWhite">
              <p>Filter</p> <FilterIcn />
            </div>
          </div>
          <Cardbar />
          <Cards />
        </div>
      </div>
      {/* <div className=" mt-[12rem]  w-[20rem]   items-start justify-center px-[4rem]  ">
        <div className="hidden h-[20rem] w-[18rem] rounded-xl bg-white md:block "></div>
      </div> */}
    </div>
  );
};

export default Main;
